import React from "react";
import "./App.css";
import AuthProvider from "./provider/authProvider";
import Routes from "./routes";
import AuthNav from "./AuthNav";
import NoAuthNav from "./NoAuthNav";
function App() {
  return (
    <>
      <AuthProvider>
        <Routes>
          <NoAuthNav />
          <AuthNav />
        </Routes>
      </AuthProvider>
    </>
  );
}

export default App;
